</h3><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="wampserver-v3-3-0_configuration-de-wampserver" href="#wampserver-v3-3-0">Configuration de WampServer</a>
</h2><br>Nous essayerons de faire pointer notre serveur web vers un port selon notre choix (9001) et un répertoire web selon notre choix (C:/dev/php/)&nbsp; qui contiendra les sources de notre projet web. Editer le fichier de configuration des modules apache (httpd.conf). Ajouter le numéro de port de notre serveur web (9001). Activer le module des machines virtuelles. Editer le fichier de configuration des machines virtuelles (httpd-vhosts.conf). Ajouter la configuration de la machine virtuelle correspondant à notre serveur web en indiquant le répertoire racine de notre serveur web (C:/dev/php/) et le répertoire des logs (C:/dev/php/logs/). Redémarrer les services.<br><br><div class="GSummary3"><div class="Summary7">
<i class="Summary8 fa fa-book"></i>
<a class="Summary9" href="#wampserver-v3-3-0_configuration-de-wampserver_fichier-de-configuration-des-modules-apache">Fichier de configuration des modules apache</a>
</div>
<div class="Summary7">
<i class="Summary8 fa fa-book"></i>
<a class="Summary9" href="#wampserver-v3-3-0_configuration-de-wampserver_fichier-de-configuration-des-machines-virtuelles">Fichier de configuration des machines virtuelles</a>
</div>
<div class="Summary7">
<i class="Summary8 fa fa-book"></i>
<a class="Summary9" href="#wampserver-v3-3-0_configuration-de-wampserver_redemarrage-des-services">Redémarrage des services</a>
</div>
</div><br><h3 class="GTitle2 Title3">
<a class="Title4" id="wampserver-v3-3-0_configuration-de-wampserver_fichier-de-configuration-des-modules-apache" href="#wampserver-v3-3-0_configuration-de-wampserver">Fichier de configuration des modules apache</a>
</h3><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">"C:\wamp64\v3.3.0\bin\apache\apache2.4.54.2\conf\httpd.conf"

# ajouter ces lignes
Listen 0.0.0.0:8001
Listen [::0]:8001

# décommenter cette ligne
LoadModule vhost_alias_module modules/mod_vhost_alias.so

# décommenter cette ligne
Include conf/extra/httpd-vhosts.conf</pre><br><h3 class="GTitle2 Title3">
<a class="Title4" id="wampserver-v3-3-0_configuration-de-wampserver_fichier-de-configuration-des-machines-virtuelles" href="#wampserver-v3-3-0_configuration-de-wampserver">Fichier de configuration des machines virtuelles</a>
</h3><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">"C:\wamp64\v3.3.0\bin\apache\apache2.4.54.2\conf\extra\httpd-vhosts.conf"

&lt;VirtualHost *:9001&gt;
    ServerName readyphp.com
    ServerAlias www.readyphp.com 
    ServerAdmin readyphp@hotmail.com
    DocumentRoot "C:/dev/php/"
    ErrorLog "C:/dev/php/logs/error.log"
    CustomLog "C:/dev/php/logs/access.log" combined

    &lt;Directory "C:/dev/php/"&gt;
        Options All
        AllowOverride All
        Order allow,deny
        allow from all
        Require all granted
    &lt;/Directory&gt;
&lt;/VirtualHost&gt;</pre><br><h3 class="GTitle2 Title3">
<a class="Title4" id="wampserver-v3-3-0_configuration-de-wampserver_redemarrage-des-services" href="#wampserver-v3-3-0_configuration-de-wampserver">Redémarrage des services</a>
</h3><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
