</h2><br>Nous essayerons d'afficher la page d'information (phpinfo) sur la configuration des modules php installés sur notre serveur apache. Ouvrir un éditeur de texte selon votre choix (Notepad++). Editer le programme PHP. Ouvrir la page web dans un navigateur web selon votre choix (Google Chrome).<br><br><div class="GSummary3"><div class="Summary7">
<i class="Summary8 fa fa-book"></i>
<a class="Summary9" href="#wampserver-v3-3-0_test-de-wampserver_ce-qu-il-faut-savoir">Ce qu'il faut savoir</a>
</div>
<div class="Summary7">
<i class="Summary8 fa fa-book"></i>
<a class="Summary9" href="#wampserver-v3-3-0_test-de-wampserver_programme-principal">Programme principal</a>
</div>
<div class="Summary7">
<i class="Summary8 fa fa-book"></i>
<a class="Summary9" href="#wampserver-v3-3-0_test-de-wampserver_resultat">Résultat</a>
</div>
</div><br><h3 class="GTitle2 Title3">
<a class="Title4" id="wampserver-v3-3-0_test-de-wampserver_ce-qu-il-faut-savoir" href="#wampserver-v3-3-0_test-de-wampserver">Ce qu'il faut savoir</a>
</h3><br>Il faut que le fichier d'entrée (index.php) soit à la racine de votre répertoire web (C:/dev/php/). Il faut que le répertoire des logs (C:/dev/php/logs/) soit créé.<br><br><h3 class="GTitle2 Title3">
<a class="Title4" id="wampserver-v3-3-0_test-de-wampserver_programme-principal" href="#wampserver-v3-3-0_test-de-wampserver">Programme principal</a>
</h3><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">&lt;?php
    phpinfo();
?&gt;</pre><br><h3 class="GTitle2 Title3">
<a class="Title4" id="wampserver-v3-3-0_test-de-wampserver_resultat" href="#wampserver-v3-3-0_test-de-wampserver">Résultat</a>
</h3><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
